import React from 'react';
import StationInfo from './StationInfo'

const StationList = ( {stationArray} ) => (
	<div><h3>Station List</h3>
	{ 
		stationArray.map(s => <StationInfo key={s.kioskID} {...s.properties}/> )
  	}
  	</div>
)


export default StationList;
